import React, {Component} from 'react';

class Writer extends Component {
	render() {
		return (
			<WriterWrapper>
				<p className='writerHeader'>推荐作者<span className='changeWriter'>换一批</span></p>
				<WriterItem>
					<a href='/'><img src='./images/writer1.webp' alt='writerImages' /></a>
				</WriterItem>
			</WriterWrapper>
		)
	}
}

export default Writer;
